import React, { useState, useEffect } from 'react';
import {
	BrowserRouter as Router,
	Routes,
	Route,
	NavLink,
	Outlet,
	useParams,
	useLocation,
	useRouteMatch,
} from 'react-router-dom';

const SubProjectLinks = (props) => {
	const subProjects = props.subProjects;
	const { url, path } = useRouteMatch();

	return (
		<div>
			{subProjects.map((subProject) => (
				<NavLink
					to={{
						pathname: `${url}/${subProject.slug}`,
						state: {
							projectEndpoint: 'sub_project',
							galleryEndpoint: 'sub_project_galleries',
						},
					}}
				>
					{subProject.title}
				</NavLink>
			))}

			<Route path={`${path}/:gallerySlug`} element={<Project />} />
		</div>
	);
};

export default SubProjectLinks;
